                    'fkgoirtjgkorjkgkorjgkrtkgkrtmgklrjmglkrtj' +
                    'fglkgmfgklgmfgkmfgkgjfklgmfglkgmfglkmgmgk' +
                    'klfmgkfgmgkrtmgkldfmgkldfmgdfklmgdlkmgkfg' +
                    'dgklmkgmtrklmerklgmdkgdmkmflkdfmglkdfmgkl' +
                    'weirjewijrewjreokwnfkgenkkjvnfklgmlkdklfg' +
                    'dfgkdfglkdfnkgldfjkgjdflkgjdgkljdfklgjdfg'}
                cloud={true}
                photoBig={false}
            />
            <BlogDiv
                type={'photoRight'}
                img={image.rocketBlankTextImage}
                text={'jkfbnl;jkwrnl;jrnbvrljnglknvbljkrgbmlkg' +
                    'ngjbnfjklgngljbnrgjgnrgjnfgjbnfgjbnfgkjbn' +
                    'jnfgbnfgkjbnfjknkjfgnbkjgnbjfgnbkjfgnbkjf' +
                    'ljfnvbljfgnjgnbjklmbjklfgmbklfgmblkfgmblk' +
                    'fkjlkfklfgmklfgvbmlkfgmglkfgmglkfgmgkmglk' +
                    'fkgjblfjmglkfjgoklkmglkrmglkmdflkgdlkgmdg' +
